import React from 'react';
//trying this below
import Fave from './Fave'


const WordRow = (props) => {

  return (
    <div>
        <p>word:{props.word.word}</p>
        <p>part of speech:{props.word.partOfSpeech}</p>
        <p>versions:{props.word.versions.map((v, i) => <div key={i}>{v}</div>)}</p>
        <p>pronunciation:{props.word.pronunciation}</p>
        <p>definition:{props.word.shortdef}</p>
        {/* <button type="submit">Remove</button>  */}
        <Fave isFave={props.isFave} handleSave={props.handleSave} />
    </div>
  );
};

export default WordRow;
